    VALUES (cart_id, p_account_id, p_stock_no, p_quantity, NOW());
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_order_list` (IN `reservationId` VARCHAR(36), IN `stockNo` VARCHAR(36), IN `qty` INT, IN `spId` VARCHAR(36))   BEGIN
