('a102f7d5-2a38-11ef-acb0-b4b52f75eaf2', 'üéâ Discover Delightful Delicacies and Convenient Copier and Printing Services on Campus! üéâ', 'Hey ARASOFIANS! Introducing our amazing roster of concessionaires, who will enhance your campus‚Äô experience by providing delectable meals and snacks as well as convenient copier and printing services!\r\n‚ú® Why Choose Campus Concessionaires?\r\nüëâ Convenience at Your Fingertips: You can discover delicious meals close by! Our concessionaires are strategically located inside the campus to ensure that you may readily satisfy your appetite in between classes.\r\nüëâ Diverse Dining Options: What do you want to eat‚Äîa satisfying meal, a light snack, or a wonderful treat? Our concessionaires offer a broad range of meals and snacks to cater to all preferences. We offer unique treats as well as comfort food!\r\nüñ®Ô∏è In addition, our copier and printing stations will make it easy for you to print documents, assignments and projects. From black-and-white essentials to full-color documents, we‚Äôve got the tools to bring your ideas to life.\r\nüéì Celebrate Your Student Journey with Every Bite!\r\nEnjoy the delicious food that is waiting for you on this campus. Our concessionaires have something special for everyone, whether you\'re a food advocate, a busy student on the go, or you\'re just seeking for an enjoyable spot to catch up.\r\nLet the feasting begin! üçΩÔ∏è‚ú®', '2024-06-14 10:26:57', 1, 0),
('be47bf63-296b-11ef-b335-b4b52f75eaf2', 'Good day, ARASOFIANS!', 'Fuel your university pride with our merchandise items available here at the Resource Generation Office. With its distinctive design and reasonable prices, each piece perfectly resonates with the spirit of our beloved institution. Come and visit the RGO office for more details!\r\n#RGOARASOFNasugbu', '2024-06-13 10:01:12', 1, 0);

